column3:
{pageend:Ciao! Felice di conoscerti.}
Mi chiamo Milena e sarò la tua guida
nel Club globale Pokémon.

Se hai effettuato l’iscrizione a pagamento
{pageend:a Nintendo Switch Online, in questo club potrai}
comunicare tramite Internet con Allenatori
di ogni parte del mondo per lottare, scambiare
{pageend:Pokémon e altro ancora!}
Premi il pulsante Y per entrare direttamente
{pageend:nella Sala contatto!}
Ricorda però che non puoi farlo mentre ti trovi
{pageend:all’interno degli edifici o in altri luoghi chiusi.}
Vuoi che ti spieghi più dettagliatamente?

Ti spiegherò come funzionano le cose
{pageend:al Club globale Pokémon.}
Dai due banconi a sinistra o premendo
{pageend:il pulsante Y, puoi entrare nella Sala globale.}
Una volta entrat{tag:0}, potrai fare scambi in link
o lotte in link con Allenatori di tutto il mondo.

Benvenut{tag:0}{pageend: nella Sala contatto!}
Questo è il Club globale Pokémon.
Vuoi usare la Sala globale?

{tag:0} ti ha offerto di mostrarti
{pageend:la sua Scheda Allenatore.}
Vuoi mostrare anche tu la tua?

{tag:0} ti propone uno scambio
{pageend:di dati.}
Accetti?

Spiacente, ma al momento non ho Pokémon
{pageend:da scambiare.}
Lo faremo un’altra volta.

{pageend:Stiamo per iniziare uno scambio di dati.}
Ehi, {tag:0}, ti andrebbe
di partecipare?

Mi spiace, ma i miei Pokémon non si sentono
{pageend:bene in questo momento.}
Sarà per un’altra volta!

Spiacente, ma non ho Pokémon da scambiare
{pageend:al momento.}
Lo faremo un’altra volta!

{pageend:Ci stiamo scambiando i dati.}
Ma certo! {tag:0}, vorresti scambiare
i tuoi dati con noi?

{pageend:Potrai scambiare Pokémon con gli altri giocatori.}
Incontrando nuove persone, avrai la possibilità
di trovare Pokémon rari!

{pageend:Oh, c’è già qualcuno qui!}
Invece di parlare con me, perché non vai
a conoscere nuovi amici?

{pageend:Esistono due modalità di lotta.}
Nella Lotta in Singolo, due Allenatori si sfidano
{pageend:mandando in campo un Pokémon alla volta.}
Nella Lotta in Doppio, due Allenatori si sfidano
mandando in campo due Pokémon alla volta.

{pageend:Il gruppo è al completo.}
Scegli i Pokémon che vuoi far partecipare
alla lotta.

{pageend:Esistono tre modalità di lotta.}
Nella Lotta in Singolo, due Allenatori si sfidano
{pageend:mandando in campo un Pokémon alla volta.}
Nella Lotta in Doppio, due Allenatori si sfidano
{pageend:mandando in campo due Pokémon alla volta.}
Nella Lotta Multipla, quattro Allenatori si sfidano
formando due squadre da due Allenatori e
mandando in campo un Pokémon alla volta.

Se hai effettuato l’iscrizione a pagamento
{pageend:a Nintendo Switch Online, in questo club potrai}
comunicare tramite Internet con Allenatori
{pageend:di ogni parte del mondo per scambiare Pokémon!}
Premi il pulsante Y per entrare direttamente
{pageend:nella Sala contatto!}
Ricorda però che non puoi farlo mentre ti trovi
{pageend:all’interno degli edifici o in altri luoghi chiusi.}
Vuoi che ti spieghi più dettagliatamente?

Ti spiegherò come funzionano le cose
{pageend:al Club globale Pokémon.}
Dai due banconi a sinistra o premendo
{pageend:il pulsante Y, puoi entrare nella Sala globale.}
Una volta entrat{tag:0}, potrai fare scambi in link
con Allenatori di tutto il mondo.
